module IllnessesHelper
  def category_image(type, css='')
    case type
      when "Tema G"
      "<img class='card-img-top #{css}' src='data:image/svg+xml;utf8;base64,' />".html_safe
      when "Tema E"
        "<img class='card-img-top #{css}' src='data:image/svg+xml;utf8;base64,' />" .html_safe
      when "Tema F"
        "<img class='card-img-top #{css}' src='
        data:image/svg+xml;utf8;base64,
        ' />".html_safe
      when "Tema H"
        "<img class='card-img-top #{css}' src='
        data:image/svg+xml;utf8;base64,'/>".html_safe
    end
  end
end